import React from "react"

class Cases extends React.Component {

  render() {
    return (
      <div>
        <div className="Tech">
          <p>{this.props.title}</p>
          <img src={this.props.image} alt="tech" />
          <p>{this.props.description}</p>
        </div>
      </div>

    )
  }
}

export default Cases
